// BOSS is always loaded. Therefore, MainController can not be used.
let app = await os.openApplication("io.bithead.boss");
let win = await app.loadController("RegisterMFA");
win.ui.show(function (ctrl) {
  ctrl.delegate = {
    didRegisterMFA: function() {
      console.log("Did register MFA");
    }
  };
});
